import React from 'react';
import Question from '../components/Question';


function QuestionList({ questions, guesses }) {

    console.log(questions)

    return (
        <div>
            <form name='quiz'>
                {questions.map(q => {
                    return <Question q={q} key={questions.indexOf(q)} />
                })}

            </form>
        </div>
    )
}

export default QuestionList
